import { createRouter, createWebHistory } from 'vue-router'

import HomeView from '@/views/HomeView.vue'
import SortView from '@/views/SortView.vue'

import SigninView from '@/views/signin/signin.vue'
import RegisterView from '@/views/signin/signin.vue'
import RegisterformView from '@/views/signin/registerform.vue'
import RegistercompleteView from '@/views/signin/complete.vue'
import ForgotPassword from '@/views/signin/forgot.vue'

import ProductPageAlchol from '@/views/product/ProductPageAlchol.vue'
import CartView from '@/views/cart/cart.vue'
import ConfirmProduct from '@/views/cart/cart.vue'


const routes = [
  {
    path: '/',
    name: 'home',
    component: HomeView
  },
  {
    path: '/signin',
    name: 'signin',
    component: SigninView
  },
  {
    path: '/register',
    name: 'register',
    component: RegisterView
  },
  {
    path: '/registerform',
    name: 'registerform',
    component: RegisterformView
  },
  {
    path: '/registercomplete',
    name: 'registercomplete',
    component: RegistercompleteView
  },
  {
    path: '/forgotpassword',
    name: 'forgotpassword',
    component: ForgotPassword
  },
  {
    path: '/sortview',
    name: 'sortview',
    component: SortView
  },
  {
    path: '/productpagealchol',
    name: 'productpagealchol',
    component: ProductPageAlchol
  },
  {
    path: '/cart',
    name: 'cart',
    component: CartView
  },
  {
    path: '/confirmproduct',
    name: 'confirmproduct',
    component: import('@/views/cart/ConfirmProduct.vue')
  },
  {
    path: '/checkout',
    name: 'checkout',
    component: import('@/views/cart/Checkout.vue')
  },
  {
    path: '/finishorder',
    name: 'finishorder',
    component: import('@/views/cart/FinishOrder.vue')
  },
  // {
  //   path: '/about',
  //   name: 'about',
  //   // route level code-splitting
  //   // this generates a separate chunk (about.[hash].js) for this route
  //   // which is lazy-loaded when the route is visited.
  //   component: () => import(/* webpackChunkName: "about" */ '../views/AboutView.vue')
  // }
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  // mode: 'history',
  routes
})

export default router
